// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FarmChain {
    // Struct to store farmer details
    struct Farmer {
        address farmerAddress;
        string name;
        string location;
        bool isRegistered;
    }

    // Struct to store product details
    struct Product {
        uint id;
        string name;
        uint price; // Price in Wei
        string description;
        string location; // Farm location
        address payable farmer;
        bool sold;
    }

    // Struct to store order details
    struct Order {
        uint orderId;
        uint productId;
        address consumer;
        uint amountPaid; // Amount paid in Wei
        uint timestamp; // Order timestamp
    }

    uint public productCount = 0; // Counter for products
    uint public orderCount = 0;   // Counter for orders

    mapping(address => Farmer) public farmers;       // Mapping of farmers by address
    mapping(uint => Product) public products;        // Mapping of products by ID
    mapping(uint => Order) public orders;            // Mapping of orders by ID

    event FarmerRegistered(address indexed farmerAddress, string name);
    event ProductRegistered(uint indexed productId, string name, uint price);
    event ProductPurchased(uint indexed productId, address indexed buyer, uint amountPaid);

    modifier onlyFarmer() {
        require(farmers[msg.sender].isRegistered, "Only registered farmers can perform this action");
        _;
    }

    // Function to register a farmer
    function registerFarmer(string memory _name, string memory _location) public {
        require(!farmers[msg.sender].isRegistered, "Farmer already registered");
        
        farmers[msg.sender] = Farmer({
            farmerAddress: msg.sender,
            name: _name,
            location: _location,
            isRegistered: true
        });

        emit FarmerRegistered(msg.sender, _name);
    }

    // Function for farmers to register a product
    function registerProduct(
        string memory _name,
        uint _price,
        string memory _description,
        string memory _location
    ) public onlyFarmer {
        require(_price > 0, "Price must be greater than zero");

        productCount++;
        
        products[productCount] = Product({
            id: productCount,
            name: _name,
            price: _price,
            description: _description,
            location: _location,
            farmer: payable(msg.sender),
            sold: false
        });

        emit ProductRegistered(productCount, _name, _price);
    }

    // Function for consumers to buy a product
    function buyProduct(uint _id) public payable {
        Product storage _product = products[_id];
        
        require(!_product.sold, "Product already sold");
        require(msg.value >= _product.price, "Insufficient funds");

        // Transfer payment to the farmer
        _product.farmer.transfer(msg.value);
        
        // Mark product as sold
        _product.sold = true;

        // Record the order details
        orderCount++;
        
        orders[orderCount] = Order({
            orderId: orderCount,
            productId: _id,
            consumer: msg.sender,
            amountPaid: msg.value,
            timestamp: block.timestamp
        });

        emit ProductPurchased(_id, msg.sender, msg.value);
    }
}

